package cn.yklove.leetcode;

/**
 * @author qinggeng
 */
public class LeetCode0392 {
    public boolean isSubsequence(String s, String t) {
        char[] sChar = s.toCharArray();
        char[] tChar = t.toCharArray();
        int[][] dp = new int[sChar.length + 1][tChar.length + 1];
        for (int i = 1; i <= sChar.length; i++) {
            for (int j = 1; j <= tChar.length; j++) {
                if (sChar[i - 1] == tChar[j - 1]) {
                    dp[i][j] = dp[i - 1][j - 1] + 1;
                } else {
                    dp[i][j] = Math.max(dp[i][j - 1], dp[i - 1][j]);
                }
            }
        }
        return dp[sChar.length][tChar.length] == sChar.length;
    }

    public static void main(String[] args) {
        System.out.println(new LeetCode0392().isSubsequence("eee", "ee"));
        System.out.println(new LeetCode0392().isSubsequence("abc", "abc"));
        System.out.println(new LeetCode0392().isSubsequence("abd", "abcdea"));
        System.out.println(new LeetCode0392().isSubsequence("abc", "ahbgdc"));
        System.out.println(new LeetCode0392().isSubsequence("leeeeetcode", "leeetcode"));
        System.out.println(new LeetCode0392().isSubsequence("leeeeetcode", ""));
    }
}
